css:
.git-menu.dialog {
  background: #313640;
  border: 1px solid rgba(24, 26, 31, 0.85);
  border-radius: 4px;
  padding: 15px;
  opacity: 0.95;
}
.git-menu.dialog .input-label .input-checkbox,
.git-menu.dialog .input-label .input-radio,
.git-menu.dialog .input-label .input-toggle,
.git-menu.dialog button {
  margin-right: 10px;
}
.git-menu.dialog .body {
  margin-bottom: 15px;
}
.git-menu.dialog .heading {
  margin-bottom: 15px;
}
.git-menu.dialog .heading strong {
  color: #d7dae0;
  display: inline-block;
}
.git-menu.dialog .heading i.icon {
  float: right;
  width: 0;
  margin-right: 15px;
  cursor: pointer;
}
.git-menu.dialog .heading i.icon:before {
  font-size: 22px;
  line-height: 17px;
}
.git-menu.dialog .heading i.icon:hover {
  color: #d7dae0;
}
.git-menu.dialog .checkbox-label,
.git-menu.dialog input[type="text"],
.git-menu.dialog select,
.git-menu.dialog textarea {
  margin-bottom: 15px;
  font-size: inherit;
}
.git-menu.dialog button:focus,
.git-menu.dialog input[type="text"]:focus,
.git-menu.dialog select:focus,
.git-menu.dialog textarea:focus {
  border-color: #6494ed;
  box-shadow: 0 0 0 1px #6494ed;
}
.git-menu.dialog button.error,
.git-menu.dialog input[type="text"].error,
.git-menu.dialog select.error,
.git-menu.dialog textarea.error {
  border-color: #ff6347;
  box-shadow: 0 0 0 1px #ff6347;
}
.git-menu.dialog input[type="checkbox"]:focus,
.git-menu.dialog input[type="radio"]:focus {
  box-shadow: 0 0 0 2px #6494ed;
}
.git-menu.dialog input[type="checkbox"].error,
.git-menu.dialog input[type="radio"].error {
  box-shadow: 0 0 0 2px #ff6347;
}
.git-menu.dialog .input-disabled,
.git-menu.dialog input[readonly],
.git-menu.dialog select[readonly],
.git-menu.dialog textarea[readonly] {
  color: rgba(157, 165, 180, 0.6);
}
.git-menu.dialog input[type=text],
.git-menu.dialog label.input-label,
.git-menu.dialog select {
  display: block;
  width: 100%;
}
